import React, { useState } from 'react';

const [formData, setFormData] = useState({
    internet: null,
    nightlife: null,
    happiness: null,
});

const changeValue = e => setFormData({ ...formData, [e.target.name]: e.target.value });

const SubmitReview = () => {
    return (
        <form>
            <label>Name:</label>
            <input name="nightlife" className="default" type="range" min="0.25" max="5" step="0.25" onChange={e => changeValue(e)} />
        </form>
    )
}

export default SubmitReview;
